export default function Combo({ list }) {
    console.log(list);
    const [isActivated, setIsActivated] = useState(false);

    const activeList = () => {
        setIsActivated(!isActivated);
    }

    return (
        <div className="combo" onClick={activeList}>
            <div className="list">
                {
                    list.length && list.map(element => (
                        <button type="button" key={`${element}_option`}>{element}</button>
                    ))
                }
            </div>
